import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Contents from "./Components/Main/Contents/Contents";
import AnotherPage from "./AnotherPage"; // 새로 연결할 페이지

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Contents />} /> {/* 기본 경로 */}
        <Route path="/another" element={<AnotherPage />} /> {/* 새로운 경로 */}
      </Routes>
    </Router>
  );
}

export default App;
